  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Today there are over 10 million Medicare-Medicaid
  enrollees in the United States.To provide a greater understanding of the Medicare-Medicaid
  enrollee population, the Centers for Medicare and Medicaid Services (CMS) has put
  together state profiles that examine the demographic characteristics, utilization,
  condition prevalence, and spending patterns of Medicare-Medicaid enrollees and the
  programs that serve them in each state.</p>n\",\n\t\"license_title\": \"Other License
